    if (props.show) {
        return (
            <div className='playPicturesModal-container'>
                <section className="playPicturesModal-main">

                    <button className="playPicturesModal-close" onClick={props.onClose}>X</button>
                </section>
            </div>
        )
    } else {
        return null
    }
}

export default withRouter(PlayPicturesModal)
